const Contact = () => {
   const [posts, setPosts] = useState([]);

   useEffect(() => {
      fetch('https://localhost:7193/api/cliente/')
         .then((res) => res.json())
         .then((data) => {
            console.log(data);
            setPosts(data);
         })
         .catch((err) => {
            console.log(err.message);
         });
   }, []);

   return (
    posts  
    // ... consume here
   );
};



export default Contact
